import './App.css';
import NavigationBar  from './components/Navigation';
import ImageLink  from './components/ImageLink';
import Rank from './components/Rank'
import 'tachyons';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      input: '',
    }
  }

  onImageLinkChange = (event) =>{
    console.log(event);
  }
  render(){
  return (
    <div className="App">
      <NavigationBar />
      <Rank />
      <ImageLink onImageLinkChance={this.onImageLinkChange} />
      {/* <FaceRecognition /> */}

    </div>
  );
}
}

export default App;
